const Card=({ id,name,username,email })=>{
    return(
            <div className="grow bg-light-green br3 pa3 ma2 dib bw2 shadow-5">
                    <img src={`https://robohash.org/${ username }?200*200`} alt="pro" />
                    <div>
                    <h1>
                        {name}
                    </h1>
                    <h1 className="text">
                        {email}
                    </h1>
                    </div>
            </div>
    )
}

export default Card;
